 beraten wir Sie persönlich und ermöglichen Ihnen den Zugang zu attraktiven Investmentmöglichkeiten des US-Zweitmarktes.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(64,64,1,'Zweitmarkt-Policen','2022-07-12 22:35:13','2022-07-12 22:35:13','e4e9aa6d-5219-45ce-893f-ecb842b933f1',NULL,NULL,'Zweitmarkt-Policen','zweitmarkt-policen','In Zeiten von Negativzinsen und grossen Schwankungen an den Kapitalmärkten, wird es für Anleger immer schwieriger angemessene Renditen auf ihrem Vermögen zu erzielen, ohne dabei ein hohes Risiko einzugehen. Eine interessante Anlageklasse ausserhalb dieses volatilen Umfelds bieten US-Zweitmarktpolicen. Dabei geht es darum, dass eine Policen-Inhaberin einen Abnehmer für ihre garantierte Risikoleistung sucht, um dringend benötigte liquide Mittel freizusetzen. Der Anleger erwirbt das Recht an dieser garantierten Versicherungsleistung.\nWar dieses Investment noch vor Jahren nur grossen institutionellen Kunden zugänglich, so ermöglichen wir es, dank unserem lizenzierten Partner, auch für ein kleineres Budget.\nSeit mehr als 100 Jahren eine Win-Win-Situation – unabhängig von der Entwicklung an den Aktienmärkten und globalen Wirtschaftskrisen.','Eines der bestgehüteten Anlagegeheimnisse. Attraktive und zuverlässige Investition im Zweitmarkt-Policenbereich. Helfen und partizipieren Sie gleichzeitig.','Attraktiv & Zuverlässig','Gerne beraten wir Sie persönlich und ermöglichen Ihnen den Zugang zu attraktiven Investmentmöglichkeiten des US-Zweitmarktes.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,