,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(194,281,1,'Retirement Solutions','2022-07-13 23:22:44','2022-07-13 23:22:44','84c3bd8a-752e-4f99-bc00-b2386efd3b69',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Massgeschneiderte  Vorsorgelösungen','Für viele Arbeitnehmende ist die zweite Säule der Eckpfeiler ihrer Altersvorsorge. Die Pensionskasse sorgt dafür, dass sie auch im Alter auf den gewohnten Lebensstandard zählen können. Bereits eine minimale Veränderung des Zinsniveaus kann zu einer wesentlichen Erhöhung der Rentenleistung nach der Pensionierung führen.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(195,282,1,'Course Intro','2022-07-13 23:53:32','2022-07-18 13:09:04','ed70f250-bcce-47b4-804b-11f8ebdedace',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ihre Zukunft in guten Händen.',NULL,'Es ist erstaunlich, dass viele Unternehmen und ihre Mitarbeitenden kaum etwas darüber wissen, wie ihr Pensionskassengeld investiert ist. Und dass, obwohl die Pensionskassenlösung in erster Linie eine Anlagelösung darstellt. Unternehmen, die sich um- und weitsichtig mit einer optimalen Vorsorgelösung auseinandersetzen, können viel bewirken. Denn die optimale Personalvorsorge ist heute ein gewichtiges Argument bei der Rekrutierung qualifizierter Mitarbeitenden. Dazu gehört nicht nur die Versorgung im Alter, sondern auch die Versicherungsleistung bei Tod und Invalidität.','Wir beraten Sie unabhängig und begleiten Sie auf dem Weg zur individuellen Pensionskassen-Lösung.','Die meisten Menschen in der Schweiz haben ihr grösstes Sparguthaben wahrscheinlich in der Pensionskasse. Dieses Geld spielt eine zentrale Rolle, welchen Lebensstandard Sie sich im Alter leisten und welche Träume Sie sich erfüllen können.','Berufliche Vorsorge erklärt','Die Pensionskasse bezahlt Frauen und Männern, die Beiträge in eine Vorsorgeeinrichtung geleistet haben, nach der Pensionierung lebenslang eine Altersrente. Zusammen mit der ersten Säule soll ein Renteneinkommen von 60 Prozent des letzten Lohns erreicht werden. Daneben versichert die zweite Säule die Risiken Tod und Invalidität.\nDie Höhe der Rente hängt von den Beiträgen ab, die während der Erwerbstätigkeit geleistet wurden. Grundsätzlich sind alle AHV-pflichtigen Personen mit einem Jahreseinkommen von über CHF 21’510.– (Stand 2022) in der Pensionskasse ihres Arbeitgebers versichert. Der Eintritt in die Pensionskasse erfolgt am 1. Januar nach Vollendung des 17. Altersjahres. Versichert sind zu diesem Zeitpunkt gemäss Gesetz nur die Risiken Tod und Invalidität. Mit dem Alter von 25 Jahren beginnt das eigentliche Alterssparen. Die Höhe der Beiträge richtet sich nach dem Lohn. Der Arbeitgeber bezahlt mindestens die Hälfte der Beiträge.','Heute für Morgen planen – Unser Schulungsangebot','Inhalte einer Schulung','Wir verstehen es als Teil unseres Angebots, Sie und Ihre Mitarbeitenden in allen Fragen zum Thema Pensionskasse und Vorsorge zu begleiten. Wir helfen ihnen bereits frühzeitig die richtigen Weichen zu stellen und zeigen auf, mit welchen Altersleistungen sie nach der Pensionierung rechnen können. Interessiert? Wir freuen uns, Sie persönlich kennenzulernen und einen möglichen Schulungsablauf zu besprechen.','Schulung anfragen','#',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(196,283,1,'Course Intro','2022-07-13 23:53:32','2022-07-13 23:53:32','1be498c1-5ba5-49a2-b664-55015ea7cacc',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(197,284,1,'Course Intro','2022-07-13 23:53:32','2022-07-13 23:53:32','2d1203ac-731f-408f-8bfa-04a40b1cbcc5',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(198,285,1,'Course Intro','2022-07-14 00:58:59','2022-07-14 00:58:59','9e1540de-45bc-4ea9-842e-b92183d34d84',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(200,335,1,'Course Intro','2022-07-14 02:20:11','2022-07-14 02:20:11','d586b4bd-1943-42ce-8eee-199d3aa70fe9',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Die meisten Menschen in der Schweiz haben ihr grösstes Sparguthaben wahrscheinlich in der Pensionskasse. Dieses Geld spielt eine zentrale Rolle, welchen Lebensstandard Sie sich im Alter leisten und welche Träume Sie sich erfüllen können.','Berufliche Vorsorge erklärt','Die Pensionskasse bezahlt Frauen und Männern, die Beiträge in eine Vorsorgeeinrichtung geleistet haben, nach der Pensionierung lebenslang eine Altersrente. Zusammen mit der ersten Säule soll ein Renteneinkommen von 60 Prozent des letzten Lohns erreicht werden. Daneben versichert die zweite Säule die Risiken Tod und Invalidität.\nDie Höhe der Rente hängt von den Beiträgen ab, die während der Erwerbstätigkeit geleistet wurden. Grundsätzlich sind alle AHV-pflichtigen Personen mit einem Jahreseinkommen von über CHF 21’51