er Partner.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(361,725,1,'Zweitmarkt-Policen','2022-07-18 13:00:48','2022-07-18 13:00:48','a3165530-200a-4eac-8be1-7f97e2a7b565',NULL,NULL,'Zweitmarkt-Policen','zweitmarkt-policen','In Zeiten von Negativzinsen und grossen Schwankungen an den Kapitalmärkten, wird es für Anleger immer schwieriger angemessene Renditen auf ihrem Vermögen zu erzielen, ohne dabei ein hohes Risiko einzugehen. Eine interessante Anlageklasse ausserhalb dieses volatilen Umfelds bieten US-Zweitmarktpolicen. Dabei geht es darum, dass eine Policen-Inhaberin einen Abnehmer für ihre garantierte Risikoleistung sucht, um dringend benötigte liquide Mittel freizusetzen. Der Anleger erwirbt das Recht an dieser garantierten Versicherungsleistung.\nWar dieses Investment noch vor Jahren nur grossen institutionellen Kunden zugänglich, so ermöglichen wir es, dank unserem lizenzierten Partner, auch für ein kleineres Budget.\nSeit mehr als 100 Jahren eine Win-Win-Situation – unabhängig von der Entwicklung an den Aktienmärkten und globalen Wirtschaftskrisen.\n\nGerne beraten wir Sie persönlich und ermöglichen Ihnen den Zugang zu attraktiven Investmentmöglichkeiten des US-Zweitmarktes.','Eines der bestgehüteten Anlagegeheimnisse. Attraktive und zuverlässige Investition im Zweitmarkt-Policenbereich. Helfen und partizipieren Sie gleichzeitig.','Attraktiv & Zuverlässig','Gerne beraten wir Sie persönlich und ermöglichen Ihnen den Zugang zu attraktiven Investmentmöglichkeiten des US-Zweitmarktes.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(363,727,1,'Klassische Anlagen','2022-07-18 13:01:34','2022-07-18 13:01:34','9f206e6b-d3fb-440b-9f21-5d4c1f3f8e77',NULL,NULL,'Klassische Anlagen','klassische-anlagen','Wir bieten umfassende Anlagelösugen, die auf Ihre Bedürfnisse, Wünsche und Lebensziele zugeschnitten sind. Gemeinsam mit unserem langjährigen Partner beraten wir Sie aktiv und weitsichtig, damit Sie Marktchancen für sich nutzen und zielgerichtet investieren können. Dabei steht ein überschaubares Risiko mithilfe einer klassischen Portfoliodiversifikation im Vordergrund. Ganz dem Zeitgeist entsprechend bieten wir auch nachhaltige Geldanlagen an, die Mehrwert für Wirtschaft, Gesellschaft und Umwelt schaffen. Übrigens, Anlegen ist bei uns bereits ab 50 Franken im Monat möglich, und dass nicht nur für privates Geld, sondern auch für gebundene Guthaben (freizügigkeitsguthaben und 3a-Gelder).','Traditionell und bewährt. Ihre individuelle Anlagestrategie in etablierten Märkten. Entwickelt und umgesetzt mit qualifizierten und beständigen Partnern.','Traditionell & bewährt','Wir freuen uns, Sie und Ihre Bedürfnisse bei einem persönlichen Gespräch näher kennenzulernen.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(364,728,1,'Klassische Anlagen','2022-07-18 13:01:51','2022-07-18 13:01:51','16c23008-c1ee-4bfd-ac7e-045d1abd41f8',NULL,NULL,'Klassische Anlagen','klassische-anlagen','Wir bieten umfassende Anlagelösugen, die auf Ihre Bedürfnisse, Wünsche und Lebensziele zugeschnitten sind. Gemeinsam mit unserem langjährigen Partner beraten wir Sie aktiv und weitsichtig, damit Sie Marktchancen für sich nutzen und zielgerichtet investieren können. Dabei steht ein überschaubares Risiko mithilfe einer klassischen Portfoliodiversifikation im Vordergrund. Ganz dem Zeitgeist entsprechend bieten wir auch nachhaltige Geldanlagen an, die Mehr