L,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(367,731,1,'Digital Assets','2022-07-18 13:03:16','2022-07-18 13:03:16','ff796046-25c7-4598-a4d6-6060e5f27b7c',NULL,NULL,'Digital Assets','digital-assets','Immer innovativere Technologien machen nicht nur unser Leben einfacher, sie schaffen auch neue Anlagemöglichkeiten. Dabei stossen gerade digitale Vermögenswerte, allen voran Kryptowährungen, auf grosses Interesse. KR Consulting hat es sich zum Ziel gesetzt, Anlegern ein besseres Verständnis von Kryptowährungen und anderen digitalen Vermögenswerten sowie der Rolle, die sie in einem Portfolio spielen können, zu vermitteln. Gemeinsam mit auf Digital Assets spezialisierten Investmentexperten zeigen wir unseren Kunden erstaunliche Anlagemöglichkeiten und Strategien auf.','Dezentral und zukunftsweisend. Spannende Investitionen in Kryptowährungen. Unsere erfahrenen Partner verfügen über das entsprechende Know-how und haben die passende Strategie für Sie.','Dezentral & zukunftsweisend','Sie möchten den Schritt in die Welt der Digital Assets wagen? Gerne beraten wir Sie persönlich.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(368,732,1,'Retirement Solutions','2022-07-18 13:04:22','2022-07-18 13:04:22','6fe6604f-7183-4f6f-8834-5ea4876114b8','Massgeschneiderte  Vorsorgelösungen','Für viele Arbeitnehmende ist die zweite Säule der Eckpfeiler ihrer Altersvorsorge. Die Pensionskasse sorgt dafür, dass sie auch im Alter auf den gewohnten Lebensstandard zählen können. Bereits eine minimale Veränderung des Zinsniveaus kann zu einer wesentlichen Erhöhung der Rentenleistung nach der Pensionierung führen.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Massgeschneiderte  Vorsorgelösungen','Für viele Arbeitnehmende ist die zweite Säule der Eckpfeiler ihrer Altersvorsorge. Die Pensionskasse sorgt dafür, dass sie auch im Alter auf den gewohnten Lebensstandard zählen können. Bereits eine minimale Veränderung des Zinsniveaus kann zu einer wesentlichen Erhöhung der Rentenleistung nach der Pensionierung führen.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(370,734,1,'Course Intro','2022-07-18 13:05:36','2022-07-18 13:05:36','2a21434c-2d6d-4d2a-937b-2c0c29049624',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ihre Zukunft in guten Händen.',NULL,'Es ist erstaunlich, dass viele Unternehmen und ihre Mitarbeitenden kaum etwas darüber wissen, wie ihr Pensionskassengeld investiert ist. Und dass, obwohl die Pensionskassenlösung in erster Linie eine Anlagelösung darstellt. Unternehmen, die sich um- und weitsichtig mit einer optimalen Vorsorgelösung auseinandersetzen, können viel bewirken. Denn die optimale Personalvorsorge ist heute ein gewichtiges Argument bei der Rekrutierung qualifizierter Mitarbeitenden. Dazu gehört nicht nur die Versorgung im Alter, sondern auch die Versicherungsleistung bei Tod und Invalidität.','Wir beraten Sie unabhängig und begleiten Sie auf dem Weg zur individuellen Pensionskassen-Lösung.','Die meisten Menschen in der Schweiz haben ihr grösstes Sparguthaben wahrscheinlich in der Pensionskasse. Dieses Geld spielt eine zentrale Rolle, welchen Lebensstandard Sie sich im Alter leisten und welche Träume Sie sich erfüllen können.','Berufliche Vorsorge erklärt','Die Pensionskasse bezahlt Frauen und Männern, die Beiträge in eine Vorsorgeeinrichtung geleistet haben, nach der Pensionierung lebenslang eine Altersrente. Zusammen mit der ersten Säule soll ein Renteneinkommen von 60 Prozent des letzten Lohns erreicht werden. Daneben versichert die zweite Säule die Risiken Tod und Invalidität.\nDie Höhe der Rente hängt von den Beiträgen ab, die während der Erwerbstätigkeit geleistet wurden. Grundsätzlich sind alle AHV-pflichtigen Personen mit einem Jahreseinkommen von über CHF 21’510.– (Stand 2022) in der Pensionskasse ihres Arbeitgebers versichert. Der Eintritt in die Pensionskasse erfolgt am 1. Januar nach Vollendung des 17. Altersjahres. Versichert sind zu diesem Zeitpunkt gemäss Gesetz nur die Risiken Tod und Invalidität. Mit dem Alter von 25 Jahren beginnt das eigentliche Alterssparen. Die Höhe der Beiträge richtet sich nach dem Lohn. Der Arbeitgeber bezahlt mindestens die Hälfte der Beiträge.','Heute für Morgen planen – Unsere Schulungen','Inhalte einer Schulung','Wir verstehen es als Teil unseres Angebots, Sie und Ihre Mitarbeitenden in allen Fragen zum Thema Pensionskasse und Vorsorge zu begleiten. Wir helfen ihnen bereits frühzeitig die richtigen Weichen zu stellen und zeigen auf, mit welchen Altersleistungen sie nach der Pensionierung rechnen können. Interessiert? Wir freuen uns, Sie persönlich kennenzulernen und einen möglichen Schulungsablauf zu besprechen.','Schulung anfragen','#',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(371,740,1,'Course Intro','2022-07-18 13:06:19','2022-07-18 13:06:19','5b2f80b7-7dcd-4e3c-931d-95f6583367ae',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Ihre Zukunft in guten Händen.',NULL,'Es ist erstaunlich, dass viele Unternehmen und ihre Mitarbeitenden kaum etwas darüber wissen, wie ihr Pensionskassengeld investiert ist. Und dass, obwohl die Pensionskassenlösung in erster Linie eine Anlagelösung darstellt. Unternehmen, die sich um- und weitsichtig mit einer optimalen Vorsorgelösung auseinandersetzen, können viel bewirken. Denn di