assenexperten sowie Investment Manager in einem. Dank unserem vielfältigen Angebot und unserer langjährigen Erfahrung können wir flexibel auf die Bedürfnisse all unserer Kunden und Kundinnen eingehen. Auf Augenhöhe und mit höchstem Anspruch, sowohl in Bezug auf Sicherheit als auch auf Mehrertrag.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Gemeinsam. Persönlich. Kompetent.','Wir sind authentische Berater – Anlage- und Finanzspezialisten, Pensionskassenexperten sowie Investment Manager in einem. Dank unserem vielfältigen Angebot und unserer langjährigen Erfahrung können wir flexibel auf die Bedürfnisse all unserer Kunden und Kundinnen eingehen. Auf Augenhöhe und mit höchstem Anspruch, sowohl in Bezug auf Sicherheit als auch auf Mehrertrag.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(376,760,1,'Team Member','2022-07-18 13:19:08','2022-07-18 13:19:08','c8152d8b-0cab-4086-bc29-db6885c515ad',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(377,763,1,'Statement','2022-07-18 13:21:22','2022-07-18 13:24:26','f6d38912-9806-4587-908f-b28a6bf0d10f',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Egal ob Investments in Immobilien, interessante Zweitmarkt-Policen oder klassische Anlagen, wir empfehlen nur, was wir selbst auch kaufen. Diese Erfah